          <text transform="matrix(1 0 0 1 956.4268 295.0962)"><tspan x="0" y="0" class="st5 st42" style="text-decoration: underline;">3</tspan><tspan x="-26.1" y="14.4" class="st5 st42">Translation:</tspan><tspan x="-38.5" y="28.8" class="st5 st42">In the cytoplasm</tspan><tspan x="-61.2" y="43.2" class="st43 st42">Protein Folding</tspan><tspan x="15.9" y="43.2" class="st5 st42"> starts, the </tspan><tspan x="-72.8" y="57.6" class="st5 st42">nucleotide sequence is read in </tspan><tspan x="-84" y="72" class="st5 st42">triplet sections called </tspan><tspan x="24.5" y="72" class="st43 st42">codons</tspan><tspan x="61.2" y="72" class="st5 st42">, each </tspan><tspan x="-93.3" y="86.4" class="st5 st42">pertaining to one amino acid. With the </tspan><tspan x="-82.2" y="100.8" class="st5 st42">help of ribosomes amino acids are </tspan><tspan x="-50.4" y="115.2" class="st5 st42">bonded into a coiling </tspan><tspan x="-73.7" y="129.6" class="st43 st42">polypeptide</tspan><tspan x="-12.6" y="129.6" class="st5 st42">, making a </tspan><tspan x="40.9" y="129.6" class="st43 st42">Protein</tspan><tspan x="77.3" y="129.6" class="st5 st42">.</tspan></text>
      </g>

          <text transform="matrix(1 0 0 1 679.9956 571.5283)"><tspan x="0" y="0" class="st5 st42" style="text-decoration: underline;">4</tspan><tspan x="-16.4" y="14.4" class="st5 st42">Protein:</tspan><tspan x="-65.1" y="28.8" class="st5 st42">The complete </tspan><tspan x="6.3" y="28.8" class="st43 st42">protein</tspan><tspan x="43.1" y="28.8" class="st5 st42"> has a </tspan><tspan x="-73.2" y="43.2" class="st5 st42">predetermined function speci</tspan><tspan x="75.5" y="43.2" class="st5 st42">-</tspan><tspan x="-40.8" y="57.6" class="st5 st42">fied by your </tspan><tspan x="21.1" y="57.6" class="st43 st42">DNA</tspan><tspan x="44.3" y="57.6" class="st5 st42">. </tspan><tspan x="-77.3" y="72" class="st5 st42">Responsible for practically every </tspan><tspan x="-87.6" y="86.4" class="st43 st42">cellular function</tspan><tspan x="-6.7" y="86.4" class="st5 st42"> in the human body, </tspan><tspan x="-59.6" y="100.8" class="st5 st42">and builds what the DNA </tspan><tspan x="-35.5" y="115.2" class="st5 st42">code describes.</tspan></text>

          <text transform="matrix(1 0 0 1 956.4268 295.0962)" class="st81"><tspan x="0" y="0" class="st5 st42" style="text-decoration: underline;">3</tspan><tspan x="-26.1" y="14.4" class="st5 st42">Translation:</tspan><tspan x="-38.5" y="28.8" class="st5 st42">In the cytoplasm</tspan><tspan x="-65.7" y="43.2" class="st5 st42">Protein Synthesis starts, the </tspan><tspan x="-72.8" y="57.6" class="st5 st42">nucleotide sequence is read in </tspan><tspan x="-84.1" y="72" class="st5 st42">three letter sections (codons), each </tspan><tspan x="-82.3" y="86.4" class="st5 st42">pertaining to one amino acid. And </tspan><tspan x="-81.1" y="100.8" class="st5 st42">with the help of ribosomes amino </tspan><tspan x="-82.9" y="115.2" class="st5 st42">acids are bonded in a coiling three </tspan><tspan x="-85.1" y="129.6" class="st5 st42">dimensional polypeptide, making a </tspan><tspan x="-16.4" y="144" class="st5 st42">Protein.</tspan></text>

          <text transform="matrix(1 0 0 1 679.9956 571.5283)" class="st81"><tspan x="0" y="0" class="st5 st42" style="text-decoration: underline;">4</tspan><tspan x="-16.4" y="14.4" class="st5 st42">Protein:</tspan><tspan x="-65.1" y="28.8" class="st5 st42">The complete protein has a </tspan><tspan x="-77.9" y="43.2" class="st5 st42">predetermined function devised </tspan><tspan x="-83.4" y="57.6" class="st5 st42">by the intial DNA strand. Responsi</tspan><tspan x="85.7" y="57.6" class="st5 st42">-</tspan><tspan x="-74.3" y="72" class="st5 st42">ble for practically every cellular </tspan><tspan x="-77.8" y="86.4" class="st5 st42">function in the human body, the </tspan><tspan x="-91.2" y="100.8" class="st5 st42">protein actualizes what the DNA code </tspan><tspan x="-64.1" y="115.2" class="st5 st42">describes (makes it reality).</tspan></text>

          <text transform="matrix(1 0 0 1 956.4268 295.0962)" class="st81"><tspan x="0" y="0" class="st5 st42" style="text-decoration: underline;">3</tspan><tspan x="-26.1" y="14.4" class="st5 st42">Translation:</tspan><tspan x="-38.5" y="28.8" class="st5 st42">In the cytoplasm</tspan><tspan x="-65.7" y="43.2" class="st5 st42">Protein Synthesis starts, the </tspan><tspan x="-72.8" y="57.6" class="st5 st42">nucleotide sequence is read in </tspan><tspan x="-84.1" y="72" class="st5 st42">three letter sections (codons), each </tspan><tspan x="-82.3" y="86.4" class="st5 st42">pertaining to one amino acid. And </tspan><tspan x="-81.1" y="100.8" class="st5 st42">with the help of ribosomes amino </tspan><tspan x="-82.9" y="115.2" class="st5 st42">acids are bonded in a coiling three </tspan><tspan x="-85.1" y="129.6" class="st5 st42">dimensional polypeptide, making a </tspan><tspan x="-16.4" y="144" class="st5 st42">Protein.</tspan></text>

          <text transform="matrix(1 0 0 1 626.8647 321.3457)"><tspan x="0" y="0" class="st92 st93">Protein</tspan><tspan x="106" y="0" class="st5 st79">:</tspan><tspan x="-114.1" y="36" class="st5 st79">The complete </tspan><tspan x="64.3" y="36" class="st92 st79">protein</tspan><tspan x="156.2" y="36" class="st5 st79"> has a </tspan><tspan x="-134.4" y="72" class="st5 st79">predetermined function speci</tspan><tspan x="237.4" y="72" class="st5 st79">-</tspan><tspan x="-53.5" y="108" class="st5 st79">fied by your </tspan><tspan x="101.4" y="108" class="st92 st79">DNA</tspan><tspan x="159.5" y="108" class="st5 st79">. </tspan><tspan x="-175.6" y="144" class="st5 st79">Proteins are responsible for practical</tspan><tspan x="278.7" y="144" class="st5 st79">-</tspan><tspan x="-183" y="180" class="st5 st79">ly every </tspan><tspan x="-80.7" y="180" class="st92 st79">cellular function</tspan><tspan x="121.7" y="180" class="st5 st79"> in the human </tspan><tspan x="-173" y="216" class="st5 st79">body, and builds what the DNA code </tspan><tspan x="-6" y="252" class="st5 st79">describes.</tspan></text>
